import {BrowserRouter,Routes,Route} from "react-router-dom";
import Dashboard from "./project/dashboard";
import Slidebar from "./components/slidebar";

import AddEnquery from "./project/addenquery";
import ViewEnquery from "./project/viewenquery";
import ViewStudents from "./project/viewstudents";
import DemoStudents from "./project/demostudent";
import Pendingfee from "./project/pendingfee";
import ViewInvestment from "./project/viewinvestment";
import AddInvestment from "./project/addinv";
import ExtraIncome from "./project/extrainc";

import Error from "./components/error";


function App() {
  return (
    <BrowserRouter>
    <Routes>
      < Route path="*" element={<Error/>}/>
      < Route path="/" element={<Dashboard/>}/>
      < Route path="/slide" element={<Slidebar/>}/>
      < Route path="/add-enquery" element={<AddEnquery/>}/>
      < Route path="/view-enquery" element={<ViewEnquery/>}/>
      < Route path="/view-students" element={<ViewStudents/>}/>
      < Route path="/view-demo" element={<DemoStudents/>}/>
      < Route path="/pending-fee" element={<Pendingfee/>}/>
      < Route path="/view-investment" element={<ViewInvestment/>}/>
      < Route path="/add-investment" element={<AddInvestment/>}/>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
